import LoginForm from "./loginForm";

function Login(){
    const [loginDetails, setLoginDetails] = useState()

    const loginBounds = {
        margin: "15rem auto",
        width: "100rem",
    }
    return(
        <div style={loginBounds}>
            <LoginForm setLoginDetails={setLoginDetails}/>
            <button onClick ={ (e) => {
                e.preventDefault()
                console.log(loginDetails)
            }}>Console Log</button>
        </div>
    )
}

export default Login
